        "description": "Kızılcık Şerbeti'nin 11. Bölümünde; Kıvılcım ve Ömer’in birlikteliği daha ilk gecenin sabahında, Metehan ve annesinin habersiz bir şekilde eve gelmesiyle büyük bir darbe alacaktır. Doğa ve Fatih ilişkisi ise rayına oturmuş gibidir. Doğa’nın üniversite arkadaşlarıyla rahat çalışması için Fatih onlara şirkette bir oda tahsis eder. Doğa’nın arkadaşı Yeliz’in ev sorununu çözen yine Fatih olacaktır. Tekneyi almayı kafasına koyan Nilay, kocası Mustafa’yı ikna ederek tefeciden para aldırır. Mustafa babasına tekneyi sattığını söylerken hayatında ilk kez ona yalan söylemenin ağırlığı altında eziliyordur. Yardımını kabul etmeyen Alev’in sıkıntılarını bilen Abdullah, elini onun üzerinden hiç çekmeyecek ama bunu ona belli etmeden yapacaktır. Doğa’nın ikiz bebeğe hamile olduğu haberi her iki ailede de mutlu bir heyecan yaratacaktır. Nursema’nın Umut ile bir kafede buluştuğu haberi Pembe’ye ulaştığında, Pembe’nin tepkisi çok sert olacaktır. Ömer’in ısrarlarına dayanamayıp onunla konuşmayı kabul eden Kıvılcım, hayatının şokunu yaşayacaktır.\n\nKızılcık Şerbeti’nin kısaca konusu:\n\nİyi eğitimli, realist ve modern bir kadın olan Kıvılcım (Evrim Alasya), eşinden boşandıktan sonra dimdik ayakta kalmış, iki kızını da inandığı değerler doğrultusunda yetiştirmiştir. Küçük kızı Çimen (Selin Türkmen) henüz liseye devam etmekte, büyük kızı Doğa (Sıla Türkoğlu) ise üniversitede diş hekimliği okumaktadır. Kıvılcım’ın tek isteği çocuklarının ileride başarılı ve mutlu olmalarını görmektir. Doğa’nın daha üniversiteye girdiği ilk yıl erkek arkadaşıyla evlenmesiyle büyük bir hayal kırıklığı yaşayan Kıvılcım, hayatının şokunu kızının kocasının ailesiyle tanışmasında yaşar. Doğa’nın kocası Fatih’in (Doğukan Güngör) ailesi muhafazakar bir ailedir. Kızının hayata bu kadar farklı bakan bir aileyle yapamayacağını düşünür. Doğa ise aşklarının her türlü farklılığın üstesinden geleceğine inanmaktadır. Kızılcık Şerbeti; doğruları aynı, yöntemleri farklı olan iki uç aile arasında kalan bir aşk hikayesidir. \n\nKızılcık Şerbeti’nin oyuncu kadrosunda; Barış Kılıç, Evrim Alasya, Settar Tanrıöğen, Sıla Türkoğlu, Sibel Taşçıoğlu, Doğukan Güngör, Müjde Uzman, Aliye Uzunatağan, Feyza Civelek, Ceren Yalazoğlu Karakoç, Emrah Altıntoprak, Feray Darıcı, Selin Türkmen, Özlem Çakar, Oral Özer, Rahimcan Kapkap, Serkan Tınmaz, Tuana Gizem Uzunlar yer alıyor. \n\nKızılcık Şerbeti yeni bölümüyle Cuma 20.00'de Show TV’de!\n\nKızılcık Şerbeti YouTube kanalına abone olmak için ➡ http://showtv.tv/fsGmQ8\nKızılcık Şerbeti Facebook hesabını takip etmek için ➡ https://www.facebook.com/kizilcikserbetitv\n\n#SılaTürkoğlu\n#BarışKılıç\n#EvrimAlasya\n#DoğukanGüngör\n#KızılcıkŞerbeti",
